 114:../asf/sam/drivers/usbhs/usbhs_device.c **** /**
 115:../asf/sam/drivers/usbhs/usbhs_device.c ****  * \ingroup udd_group
 116:../asf/sam/drivers/usbhs/usbhs_device.c ****  * \defgroup udd_udphs_group USB High-Speed Port for device mode (USBHS)
 117:../asf/sam/drivers/usbhs/usbhs_device.c ****  *
 118:../asf/sam/drivers/usbhs/usbhs_device.c ****  * \section USBHS_CONF USBHS Custom configuration
 119:../asf/sam/drivers/usbhs/usbhs_device.c ****  * The following USBHS driver configuration must be included in the conf_usb.h
 120:../asf/sam/drivers/usbhs/usbhs_device.c ****  * file of the application.
 121:../asf/sam/drivers/usbhs/usbhs_device.c ****  *
 122:../asf/sam/drivers/usbhs/usbhs_device.c ****  * UDD_USB_INT_LEVEL<br>
 123:../asf/sam/drivers/usbhs/usbhs_device.c ****  * Option to change the interrupt priority (0 to 15) by default 5 (recommended).
 124:../asf/sam/drivers/usbhs/usbhs_device.c ****  *
 125:../asf/sam/drivers/usbhs/usbhs_device.c ****  * UDD_USB_INT_FUN<br>
 126:../asf/sam/drivers/usbhs/usbhs_device.c ****  * Option to fit interrupt function to what defined in exception table.
 127:../asf/sam/drivers/usbhs/usbhs_device.c ****  *
 128:../asf/sam/drivers/usbhs/usbhs_device.c ****  * UDD_ISOCHRONOUS_NB_BANK(ep)<br>
 129:../asf/sam/drivers/usbhs/usbhs_device.c ****  * Feature to reduce or increase isochronous endpoints buffering (1 to 3).
 130:../asf/sam/drivers/usbhs/usbhs_device.c ****  * Default value 2.
 131:../asf/sam/drivers/usbhs/usbhs_device.c ****  *
 132:../asf/sam/drivers/usbhs/usbhs_device.c ****  * UDD_BULK_NB_BANK(ep)<br>
 133:../asf/sam/drivers/usbhs/usbhs_device.c ****  * Feature to reduce or increase bulk endpoints buffering (1 to 2).
 134:../asf/sam/drivers/usbhs/usbhs_device.c ****  * Default value 2.
 135:../asf/sam/drivers/usbhs/usbhs_device.c ****  *
 136:../asf/sam/drivers/usbhs/usbhs_device.c ****  * UDD_INTERRUPT_NB_BANK(ep)<br>
 137:../asf/sam/drivers/usbhs/usbhs_device.c ****  * Feature to reduce or increase interrupt endpoints buffering (1 to 2).
 138:../asf/sam/drivers/usbhs/usbhs_device.c ****  * Default value 1.
 139:../asf/sam/drivers/usbhs/usbhs_device.c ****  *
 140:../asf/sam/drivers/usbhs/usbhs_device.c ****  * \section Callbacks management
 141:../asf/sam/drivers/usbhs/usbhs_device.c ****  * The USB driver is fully managed by interrupt and does not request periodique
 142:../asf/sam/drivers/usbhs/usbhs_device.c ****  * task. Thereby, the USB events use callbacks to transfer the information.
 143:../asf/sam/drivers/usbhs/usbhs_device.c ****  * The callbacks are declared in static during compilation or in variable during
 144:../asf/sam/drivers/usbhs/usbhs_device.c ****  * code execution.
 145:../asf/sam/drivers/usbhs/usbhs_device.c ****  *
ARM GAS  /tmp/ccUxUtGN.s 			page 4


 146:../asf/sam/drivers/usbhs/usbhs_device.c ****  * Static declarations defined in conf_usb.h:
 147:../asf/sam/drivers/usbhs/usbhs_device.c ****  * - UDC_VBUS_EVENT(bool b_present)<br>
 148:../asf/sam/drivers/usbhs/usbhs_device.c ****  *   To signal Vbus level change
 149:../asf/sam/drivers/usbhs/usbhs_device.c ****  * - UDC_SUSPEND_EVENT()<br>
 150:../asf/sam/drivers/usbhs/usbhs_device.c ****  *   Called when USB bus enter in suspend mode
 151:../asf/sam/drivers/usbhs/usbhs_device.c ****  * - UDC_RESUME_EVENT()<br>
 152:../asf/sam/drivers/usbhs/usbhs_device.c ****  *   Called when USB bus is wakeup
 153:../asf/sam/drivers/usbhs/usbhs_device.c ****  * - UDC_SOF_EVENT()<br>
 154:../asf/sam/drivers/usbhs/usbhs_device.c ****  *   Called for each received SOF, Note: Each 1ms in HS/FS mode only.
 155:../asf/sam/drivers/usbhs/usbhs_device.c ****  *
 156:../asf/sam/drivers/usbhs/usbhs_device.c ****  * Dynamic callbacks, called "endpoint job" , are registered
 157:../asf/sam/drivers/usbhs/usbhs_device.c ****  * in udd_ep_job_t structure via the following functions:
 158:../asf/sam/drivers/usbhs/usbhs_device.c ****  * - udd_ep_run()<br>
 159:../asf/sam/drivers/usbhs/usbhs_device.c ****  *   To call it when a transfer is finish
 160:../asf/sam/drivers/usbhs/usbhs_device.c ****  * - udd_ep_wait_stall_clear()<br>
 161:../asf/sam/drivers/usbhs/usbhs_device.c ****  *   To call it when a endpoint halt is disabled
 162:../asf/sam/drivers/usbhs/usbhs_device.c ****  *
 163:../asf/sam/drivers/usbhs/usbhs_device.c ****  * \section Power mode management
 164:../asf/sam/drivers/usbhs/usbhs_device.c ****  * The Sleep modes authorized :
 165:../asf/sam/drivers/usbhs/usbhs_device.c ****  * - in USB IDLE state, the USBHS needs of USB clock and authorizes up to sleep mode WFI.
 166:../asf/sam/drivers/usbhs/usbhs_device.c ****  * - in USB SUSPEND state, the USBHS no needs USB clock and authorizes up to sleep mode WAIT.
 167:../asf/sam/drivers/usbhs/usbhs_device.c ****  * @{
